import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faMagnifyingGlass } from '@fortawesome/free-solid-svg-icons';


function TopBar() {
  return (
    <div className="absolute w-full h-36 bg-white shadow-md shadow-gray-600">
        <div className="absolute left-96 top-12">
        <FontAwesomeIcon icon={faMagnifyingGlass} className="size-8 text-red-400"/>
        <input type="search" id="search" className="block w-16 "></input>
        </div>

    </div>
  )
}

export default TopBar
